inline float float_rand(float minvalue, float maxvalue)
{
    float scale = rand() / (float)RAND_MAX;
    return minvalue + scale * (maxvalue - minvalue);
}

inline float gamma(float x) {
    if (x <= a)
        return 0;
    else if (x > b)
        return 1;
    else return ((x - a)/(b - a));
}

