bool pali(string s){
    string t = s;
    reverse(t.begin(), t.end());
    return s == t;
}

void solve(){
    int n; cin>>n;
    vector<string> v(n);
    for(int i=0; i<n; i++) cin>>v[i];
    for(int i=0;i<n;i++){
        for(int j=i+1;j<n;j++){
            if(pali(v[i]+v[j]) || pali(v[j]+v[i])){
                cout<<"Yes\n";
                return;
            }
        }
    }
    cout<<"No\n";
}

